css:
.git-plus .alert {
  color: #b58900;
}
.git-plus .success {
  color: #859900;
}
.git-plus .overlay.from-bottom {
  width: 600px;
}
.git-plus .info-view {
  overflow: auto;
}
.meta.diff.range.unified {
  color: #657b83;
}
.meta.diff.header {
  color: #657b83;
}
.markup.deleted.diff {
  color: #cb4b16;
}
.markup.inserted.diff {
  color: #859900;
}
